import React from "react";

function Profile() {
  return (
    <div>
      <div className="nav-pro">
        <h3>User Profile</h3>
        <ul className="nav-links">
          <li>Home</li>
          <li>Notifications</li>
          <li>Profile</li>
        </ul>
      </div>
      <h1> Profile Page</h1>
    </div>
  );
}

export default Profile;
